import Button from './Button'

const Header = ({ onAdd, showAdd }) => {
  return (
    <header className='header'>
      <h1>Task Manager</h1>
      <Button color='green' text={showAdd ? 'close' : 'Add'} onClick={onAdd} />
    </header>
  )
}

export default Header
